from binascii import b2a_hex
from Crypto.Cipher import AES
data = ''''''

data = data.replace('-','+').replace('_','/')


mode = AES.MODE_ECB
key2 = '''3a874168f88d475f'''
cryptor = AES.new(key2.encode('utf-8'), mode)
import base64
with open('result.txt','wb' ) as f:
    f.write(cryptor.decrypt(base64.decodebytes(data.encode('utf-8'))))

